// Portfolio.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/styles.css';
import Nav from '../components/Navigation';
import Skills from '../components/mySkills';
import Contact from '../components/ContactMe';
import MyWork from '../components/myWork';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faXmark, faArrowRight } from '@fortawesome/free-solid-svg-icons';
import htmlImage from '../images/html.png'; 
import ProfileImage from '../images/PortfolioImage.jpg';

function Portfolio() {
  const navigate = useNavigate();

  const handleMoreAboutMeClick = () => {
    navigate('/mySkills');
  };

  return (
    <section className='about-me'>
      <div className='about-content'>

        <div className='about-me-content' id="about">
          <div className='info-holder'>
            <div className='name-holder'>
              <h1>
                <span className="first-part">-Kristaps</span> <span className="second-part">Junior</span>
                <p className='web-developer-p'>WEB DEVELOPER</p>
              </h1>
              <p>Hello! My name is Martin Ryan Lacis, and I'm a passionate 
                web developer with a focus on frontend development. With a keen eye for design and a love for creating 
                intuitive user experiences, I strive to bring ideas to life on the web. My expertise lies in crafting responsive and 
                engaging websites using the latest technologies and best practices in the industry.</p>
                <button onClick={handleMoreAboutMeClick}>MORE ABOUT ME <FontAwesomeIcon icon={faArrowRight} size='2x'/></button>
            </div>
          </div>
          <div className='image-holder'>
            <img src={ProfileImage} alt="Profile" />
          </div>
        </div>
        <div className='skills-section' id="skills">
          <Skills />
        </div>
        <div className='skills-section' id="myWork">
          <MyWork />
        </div>
        <div className='skills-section' id="contact">
          <Contact />
        </div>

      </div>
      <Nav />
    </section>
  );
}

export default Portfolio;
